function log(o){DEVELOPMENT&&console.log(`%c[Log] ${o}`,"color: #00a2ff;")}function error(o){console.error(o)}function distance(o,n,r,t){var c=o-n,e=r-t;return Math.sqrt(c*c+e*e)}function random(o,n){return Math.floor(Math.random()*(n-o)+o)}function checkIntersection(o,n,r,t,c,e,a,f){return n>=r&&o<=t&&c<=f&&e>=a}
